import AppBar from '@mui/material/AppBar';
import logo from './images/EZR.png';
import './App.css';

function App() {
  return (



      <AppBar position="static">  
      <AdbIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            LOGO
          </Typography>   
      </AppBar> 




  );
}

export default App;
